xwikidoc.content:
In a near future it will be possible to have XWiki installed as a Portlet in any Portal. As of now it has been tested with [[eXo Platform>>http://www.exoplatform.com/company/en/home]]. There are some issues that the XWiki development team is currently working on. Please ask on the [[Mailing Lists>>dev:Community.MailingLists]] if you want to know more.

